import React from "react";
import classes from "./SelectCar.module.css";

const SelectCar = ({selectedPay, isOpen, onClose}) => {
    if(!isOpen){
        return null
    }
  return (
    <div className={classes.car}>
      <h4>Lokacija</h4>
      <p>{selectedPay.name}</p>
      <p>{selectedPay.price} KM</p>
      <button onClick={onClose}>Plati</button>
      <button onClick={onClose}>Close</button>
    </div>
  );
};

export default SelectCar;
